import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => (
  <div>
    <h2>Welcome to gatepass</h2>
    <img src="cbit_logo.jpeg" alt="Your App" />
    <div>
      <Link to="/Login">
        <button>Login</button>
      </Link>
      <Link to="/Register">
        <button>Register</button>
      </Link>
    </div>
  </div>
);

export default Home;
